  `create_by` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '创建人',
  `update_at` bigint(20) NULL DEFAULT NULL COMMENT '修改时间的时间戳',
  `update_by` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `serial_no`(`serial_no`) USING BTREE COMMENT '一个用户只能有一个编码',
  INDEX `gender`(`gender_dict_id`) USING BTREE,
  INDEX `is_lock`(`is_lock`) USING BTREE,
  INDEX `create_at`(`create_at`) USING BTREE,
  INDEX `update_at`(`update_at`) USING BTREE,
  INDEX `dept_id`(`dept_id`) USING BTREE,
  INDEX `nickname`(`nickname`) USING BTREE,
  INDEX `comp_id`(`comp_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '后台管理用户表' ROW_FORMAT = Compact;

